        ArrayList<vehicle_Data> dlist = new ArrayList();
        dlist.add(new vehicle_Data("Toyota Prado",a1,"TXL",119000));
        dlist.add(new vehicle_Data("Mitsuibishi ",a2,"ASX",65000));
        dlist.add(new vehicle_Data("Mini Cooper",a3,"John Cooper",75000));
        dlist.add(new vehicle_Data("Chervolet Cruze",a4,"Ls",28000));
        dlist.add(new vehicle_Data("Toyota Prado",a4,"Ls",28000));
        dlist.add(new vehicle_Data("Mini Cooper",a4,"Ls",28000));
        dlist.add(new vehicle_Data("Chervolet Cruze",a4,"Ls",28000));
        dlist.add(new vehicle_Data("Chervolet Cruze",a4,"Ls",28000));
